A year ago I traveled to Burningman for my honeymoon. Me and my husband at the time shared many moments of both bliss and ecstasy.‚Å†‚†Ä
‚Å†‚†Ä
Many of you probably wonder what happened to us. So do I‚Ä¶ Sometimes life just happens and suddenly you find yourself in a place you couldn‚Äôt have guessed. ‚Å†‚†Ä
‚Å†‚†Ä
Life presented many lessons during that time. One of them was to lose an unborn child. I was alone at the midwife when she told me that there was no heartbeat.‚Å†‚†Ä
‚Å†‚†Ä
I lost my job in May. We divorced in June. I decided to take the opportunity to grow even further. To get to know myself better. To explore my emotions and become aware of being aware. I chose gratitude. Even for the darkness, as I know that darkness is such a great teacher. I practiced the art of surrender and presence each day. My meditation pillow found its way back into my daily routine. ‚Å†‚†Ä
‚Å†‚†Ä
It is so beautiful to dare to trust. To trust in life. It's so beautiful to breathe in each lesson that unfolds in front of me. And to do so without any resistance. It's so relieving to be brave enough to let go. Letting go always creates space for something new. And with a loving heart, that new will always be something beautiful. ‚Å†‚†Ä
‚Å†‚†Ä
I am grateful for all that I‚Äôve got to experience this last year. Even the most difficult event of them all -to lose my dear grandmother. I feel such a flood of gratitude when I think about how she passed as we held her in our arms. Her children and grandchildren. And how we opened the window so that her spirit could fly out. That is beauty. Life. Raw. Real. Love!‚Å†‚†Ä
‚Å†‚†Ä
Thank you life for all the magic I get to experience in this physical form. Thank you for always being gentle with me and giving me lessons that you know I can handle. I am grateful to be here. To simply live. To feel it all. Light and darkness. I love You!‚Å†‚†Ä
